import { StyleSheet } from 'react-native';

export const styles = StyleSheet.create({
    itemContainer: {
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
        margin: 8,
        padding: 8,
        borderWidth: 1,
        borderColor: '#ccc',
        borderRadius: 8,
    },
    sprite: {
    width: 50,
    height: 50,
    resizeMode: 'contain'
    }
});
